import { Box, Stack, TextField } from "@mui/material";
import React from "react";

function Register() {
  return (
    <Box p={5}>
      <TextField label="Enter username" />
      <TextField label="Enter password" />
      <Button variant="outlined" mx={4}>
        Login
      </Button>
    </Box>
  );
}

export default Register;
